window.bookSummaryJSON = "<p><b>She's going to scream for me and I don't care who hears it.</b></p> <p>I traveled to this city to disrupt the plans of the Brotherhood's enemies, not tame a defiant omega, but the moment Revna challenged me, I knew punishing her would not be enough.</p> <p>Despite her blushing protests, I'm going to bare her beautiful body and mark her quivering bottom with my belt, but she won't be truly put in her place until I put her flat on her back. </p> <p>I'm her alpha and I will use her as I please.</p> <p><b>Publisher's Note:</b> <i>Wild</i> is a stand-alone novel which is the fourth entry in the Alpha Brotherhood series. It includes spankings, rough sexual scenes, intense and humiliating punishments, and strong D/s themes. If such material offends you, please don't buy this book.</p>"; 
